import React from "react";
import "./Nav.css";
import Search from "./search";
import Signout from "./signout";

//Nav bar (Login info, photo, time(momentJS), categories, logout)
// email: "luke.fantom@gmail.com";
// id: "0ASwVpubDKNqswzlAxAOpeKdtCK2";
// photo: "https://lh3.googleusercontent.com/a-/AOh14GhtH0n2VCVQDkAhTT0IfvIKJeig059KEi84fR2l0w=s96-c";
// userName: "Luke Fantom";

function Nav({ user, handleNewSearch, signOut }) {
  const { email, id, photo, userName } = user;

  return (
    <nav>
      <ul>
        {user && (
          <li>
            <Signout signOut={signOut} />
          </li>
        )}
        <li>
          <p>{email}</p>
        </li>
        <li>
          <img className="userImg" src={photo} alt="user" />
        </li>
      </ul>
      <Search className="search" handleNewSearch={handleNewSearch} />
    </nav>
  );
}

export default Nav;
